class process_behaviour(webapp2.RequestHandler):
	def post(self):
		if self.request.get('targetTag') == "":
			vote = models.behaviourRecords(
            ip_addr = self.request.remote_addr,
            current_tag = self.request.get('tag'),
            action = self.request.get('action')
        	)
		else:
			vote = models.behaviourRecords(
	            ip_addr = self.request.remote_addr,
	            current_tag = self.request.get('tag'),
	            action = self.request.get('action'),
	            target_tag = self.request.get('targetTag')
	        )
		vote.put()

